const buttonStyle = {
  background: "blue",
  "border-radius": 5,
  "justify-content": "center",
  width: "99%",
  border: "1px solid #ccc",
  height: "2rem",
  cursor: "pointer",
  color: "white",
};

const AddTodo = () => {
  return (
    <div>
      <div className="add-todo-container">
        <input type="text" required autoFocus placeholder="New Todo" />
        <button style={buttonStyle}>Add New Task</button>
      </div>
    </div>
  );
};

export default AddTodo;
